    "contracts/pool/SmartDisPatchInitializable.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity >=0.7.6;
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/proxy/Initializable.sol";
import "../core/SafeOwnable.sol";
import "hardhat/console.sol";

contract SmartDisPatchInitializable is SafeOwnable, Initializable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    mapping(address => bool) private _isExcludedHolderBlack;

    uint256 public constant MAX_SUPPLY_TOKEN = 500;
    // The address of the smart chef factory
    address public SMART_DISPATCH_FACTORY;
    uint256 private _totalSupply;
    mapping(address => uint256) private _balances;
    mapping(address => PoolInfo) private poolInfos;
    mapping(address => uint256) public excludeBalances;
    mapping(address => uint256) public claimedTotal;
    address[] public rewardTokens;

    struct PoolInfo {
        bool enable;
        IERC20 rewardToken;
        uint256 reserve;
        uint256 rewardLastStored;
        mapping(address => uint256) userRewardStored;
        mapping(address => uint256) newReward;
        mapping(address => uint256) claimedReward;
    }
    event AddPool(address indexed token);
    event Staked(address indexed user, uint256 amount);
    event Withdrawn(address indexed user, uint256 amount);
    event RewardPaid(
        address indexed user,
        address indexed token,
        uint256 reward
    );

    constructor() {
        SMART_DISPATCH_FACTORY = msg.sender;
    }

    function initialize(address[] memory rewardTokens_, address admin_)
        external
        initializer
    {
        require(msg.sender == SMART_DISPATCH_FACTORY, "Not factory");
        rewardTokens = rewardTokens_;
        for (uint256 i = 0; i != rewardTokens_.length; i++) {
            poolInfos[rewardTokens_[i]].rewardToken = IERC20(rewardTokens_[i]);
            poolInfos[rewardTokens_[i]].enable = true;
        }

        setPendingOwner(admin_);
    }

    function isExcludedHolderBlack(address account) public view returns (bool) {
        return _isExcludedHolderBlack[account];
    }

    modifier updateDispatch(address account) {
        for (uint256 i = 0; i != rewardTokens.length; i++) {
            address token = rewardTokens[i];
            PoolInfo storage pool = poolInfos[token];
            if (pool.enable) {
                pool.rewardLastStored = rewardPer(pool);
                if (pool.rewardLastStored > 0) {
                    uint256 balance = pool.rewardToken.balanceOf(address(this));
                    pool.reserve = balance;
                    if (account != address(0)) {
                        pool.newReward[account] = available(token, account);
                        pool.userRewardStored[account] = pool.rewardLastStored;
                    }
                }
            }
        }
        _;
    }

    function addPool(address token) external onlyOwner {
        require(
            address(poolInfos[token].rewardToken) == address(0),
            "pool is exits"
        );
        require(
            rewardTokens.length < MAX_SUPPLY_TOKEN,
            "supported token types exceed the limit"
        );
        poolInfos[token].rewardToken = IERC20(token);
        poolInfos[token].enable = true;
        rewardTokens.push(token);

        emit AddPool(token);
    }

    function enablePool(address token, bool enable) external onlyOwner {
        require(
            address(poolInfos[token].rewardToken) != address(0),
            "pool not is exits"
        );
        poolInfos[token].rewardToken = IERC20(token);
        poolInfos[token].enable = enable;
    }

    function excludedHolderBlack(address account)
        public
        updateDispatch(account)
        onlyOwner
    {
        require(!_isExcludedHolderBlack[account], "is holder black");
        _isExcludedHolderBlack[account] = true;

        _totalSupply = _totalSupply.sub(_balances[account]);
        excludeBalances[account] = _balances[account];
        _balances[account] = 0;
    }

    function includeHolderBlack(address account)
        public
        updateDispatch(account)
        onlyOwner
    {
        require(_isExcludedHolderBlack[account], "not is holder black");
        _isExcludedHolderBlack[account] = false;

        _totalSupply = _totalSupply.add(excludeBalances[account]);
        _balances[account] = excludeBalances[account];
        excludeBalances[account] = 0;
    }

    function getAllSupplyTokens() public view returns (address[] memory) {
        return rewardTokens;
    }

    function claimedReward(address token, address account)
        public
        view
        returns (uint256)
    {
        PoolInfo storage pool = poolInfos[token];
        return pool.claimedReward[account];
    }

    function lastReward(PoolInfo storage pool) private view returns (uint256) {
        if (_totalSupply == 0) {
            return 0;
        }
        uint256 balance = pool.rewardToken.balanceOf(address(this));
        return balance.sub(pool.reserve);
    }

    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    function rewardPer(PoolInfo storage pool) private view returns (uint256) {
        if (totalSupply() == 0) {
            return pool.rewardLastStored;
        }
        return
            pool.rewardLastStored.add(
                lastReward(pool).mul(1e18).div(totalSupply())
            );
    }

    function stake(address account, uint256 amount)
        external
        updateDispatch(account)
    {
        require(msg.sender == SMART_DISPATCH_FACTORY, "Not factory");
        if (_isExcludedHolderBlack[account]) {
            excludeBalances[account] = excludeBalances[account].add(amount);
            return;
        }
        _totalSupply = _totalSupply.add(amount);
        _balances[account] = _balances[account].add(amount);
        emit Staked(account, amount);
    }

    function withdraw(address account, uint256 amount)
        external
        updateDispatch(account)
    {
        require(msg.sender == SMART_DISPATCH_FACTORY, "Not factory");
        if (_isExcludedHolderBlack[account]) {
            if (amount > excludeBalances[account]) {
                amount = excludeBalances[account];
            }
            excludeBalances[account] = excludeBalances[account].sub(amount);
            return;
        }
        if (_balances[account] < amount) {
            amount = _balances[account];
        }
        if (amount == 0) {
            return;
        }
        _totalSupply = _totalSupply.sub(amount);
        _balances[account] = _balances[account].sub(amount);
        emit Withdrawn(account, amount);
    }

    function available(address token, address account)
        public
        view
        returns (uint256)
    {
        PoolInfo storage pool = poolInfos[token];
        return
            balanceOf(account)
                .mul(rewardPer(pool).sub(pool.userRewardStored[account]))
                .div(1e18)
                .add(pool.newReward[account]);
    }

    function claim(address token) external updateDispatch(msg.sender) {
        PoolInfo storage pool = poolInfos[token];
        uint256 reward = available(token, msg.sender);
        if (reward <= 0) {
            return;
        }
        pool.rewardToken.safeTransfer(msg.sender, reward);
        pool.reserve = pool.reserve.sub(reward);
        pool.newReward[msg.sender] = 0;
        claimedTotal[token] = claimedTotal[token].add(reward);
        pool.claimedReward[msg.sender] = pool.claimedReward[msg.sender].add(
            reward
        );
        emit RewardPaid(msg.sender, token, reward);
    }
}
"
    },
    "contracts/token/SMToken.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity 0.7.6;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "../core/SafeOwnable.sol";
import "../interfaces/IEMEFactory.sol";
import "../pool/SmartDisPatchInitializable.sol";

contract SMToken is ERC20, SafeOwnable {
    using SafeMath for uint256;
    using Address for address;

    mapping(address => bool) private _isExcludedFromFee;
    mapping(address => bool) public pairs;
    mapping(address => bool) public minners;
    uint256 public pairRewardPercentForBuy = (5 * 1e6) / 100; //5%
    uint256 public nftRewardPercentForBuy = (5 * 1e6) / 100; //5%
    uint256 public tokenRewardPercentForBuy = (25 * 1e6) / 1000; //2.5%
    uint256 public pairRewardPercentForSell = (5 * 1e6) / 100; //5%
    uint256 public nftRewardPercentForSell = (5 * 1e6) / 100; //5%
    uint256 public tokenRewardPercentForSell = (25 * 1e6) / 1000; //2.5%
    address public pairRewardDispatch;
    address public nftRewardDispatch;
    address public dispatchHandler;
    uint256 public minimumHoldingReward = 2000 * 10**18;

    event AddPair(address pair);
    event DelPair(address pair);

    constructor() ERC20("Sarmetaverse", "SMT") {
        _mint(msg.sender, 100 * 10**8 * 10**decimals());
    }

    function setPairRewardDispatch(address _pairRewardDispatch)
        external
        onlyOwner
    {
        pairRewardDispatch = _pairRewardDispatch;
    }

    function setMinimumHoldingReward(uint256 _minimumHoldingReward)
        external
        onlyOwner
    {
        minimumHoldingReward = _minimumHoldingReward;
    }

    function setNFTRewardDispatch(address _nftRewardDispatch)
        external
        onlyOwner
    {
        nftRewardDispatch = _nftRewardDispatch;
    }

    function excludeFromFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = true;
    }

    function includeInFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = false;
    }

    function isExcludedFromFee(address account) public view returns (bool) {
        return _isExcludedFromFee[account];
    }

    function setDispatchHandler(address _dispatch) external onlyOwner {
        dispatchHandler = _dispatch;
    }

    function setPairRewardPercentForBuy(uint256 _percent) external onlyOwner {
        pairRewardPercentForBuy = _percent;
    }

    function setPairRewardPercentForSell(uint256 _percent) external onlyOwner {
        pairRewardPercentForSell = _percent;
    }

    function setNFTRewardPercentForBuy(uint256 _percent) external onlyOwner {
        nftRewardPercentForBuy = _percent;
    }

    function setTokenRewardPercentForBuy(uint256 _percent) external onlyOwner {
        tokenRewardPercentForBuy = _percent;
    }

    function setNFTRewardPercentForSell(uint256 _percent) external onlyOwner {
        nftRewardPercentForSell = _percent;
    }

    function setTokenRewardPercentForSell(uint256 _percent) external onlyOwner {
        tokenRewardPercentForSell = _percent;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual override {
        if (
            (!_isExcludedFromFee[from] && !_isExcludedFromFee[to]) &&
            (pairs[from] || pairs[to])
        ) {
            amount = calculateFee(from, to, amount);
        }
        super._transfer(from, to, amount);
    }

    function calculateFee(
        address from,
        address to,
        uint256 amount
    ) private returns (uint256) {
        if (pairs[from]) {
            uint256 tradeFeeToPairReward = amount
                .mul(pairRewardPercentForBuy)
                .div(1e6);
            if (pairRewardDispatch != address(0) && tradeFeeToPairReward > 0) {
                amount = amount.sub(tradeFeeToPairReward);
                super._transfer(from, pairRewardDispatch, tradeFeeToPairReward);
            }
            uint256 tradeFeeToNFTReward = amount
                .mul(nftRewardPercentForBuy)
                .div(1e6);
            if (nftRewardDispatch != address(0) && tradeFeeToNFTReward > 0) {
                amount = amount.sub(tradeFeeToNFTReward);
                super._transfer(from, nftRewardDispatch, tradeFeeToNFTReward);
            }
            uint256 tradeFeeToTokenReward = amount
                .mul(tokenRewardPercentForBuy)
                .div(1e6);
            if (dispatchHandler != address(0) && tradeFeeToTokenReward > 0) {
                amount = amount.sub(tradeFeeToTokenReward);
                super._transfer(from, dispatchHandler, tradeFeeToTokenReward);
            }
        } else if (pairs[to]) {
            uint256 tradeFeeToPairReward = amount
                .mul(pairRewardPercentForSell)
                .div(1e6);
            if (pairRewardDispatch != address(0) && tradeFeeToPairReward > 0) {
                amount = amount.sub(tradeFeeToPairReward);
                super._transfer(from, pairRewardDispatch, tradeFeeToPairReward);
            }
            uint256 tradeFeeToNFTReward = amount
                .mul(nftRewardPercentForSell)
                .div(1e6);
            if (nftRewardDispatch != address(0) && tradeFeeToNFTReward > 0) {
                amount = amount.sub(tradeFeeToNFTReward);
                super._transfer(from, nftRewardDispatch, tradeFeeToNFTReward);
            }
            uint256 tradeFeeToTokenReward = amount
                .mul(tokenRewardPercentForSell)
                .div(1e6);
            if (dispatchHandler != address(0) && tradeFeeToTokenReward > 0) {
                amount = amount.sub(tradeFeeToTokenReward);
                super._transfer(from, dispatchHandler, tradeFeeToTokenReward);
            }
        }
        return amount;
    }

    function expectPair(
        IEMEFactory _factory,
        address _tokenA,
        address _tokenB
    ) public pure returns (address pair) {
        (address token0, address token1) = _tokenA < _tokenB
            ? (_tokenA, _tokenB)
            : (_tokenB, _tokenA);
        pair = address(
            uint160(
                uint256(
                    keccak256(
                        abi.encodePacked(
                            hex"ff",
                            _factory,
                            keccak256(abi.encodePacked(token0, token1)),
                            _factory.INIT_CODE_PAIR_HASH()
                        )
                    )
                )
            )
        );
    }

    function addPairByFactory(IEMEFactory _factory, address _token)
        external
        onlyOwner
    {
        address pair = expectPair(_factory, address(this), _token);
        pairs[pair] = true;
        emit AddPair(pair);
    }

    function addPair(address _pair) external onlyOwner {
        pairs[_pair] = true;
        emit AddPair(_pair);
    }

    function delPair(address _pair) external onlyOwner {
        delete pairs[_pair];
        emit DelPair(_pair);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        if (dispatchHandler != address(0)) {
            if (from != address(0)) {
                uint256 power = amount;
                if (balanceOf(from).sub(amount) < minimumHoldingReward) {
                    power = SmartDisPatchInitializable(dispatchHandler)
                        .balanceOf(from);
                }
                SmartDisPatchInitializable(dispatchHandler).withdraw(
                    from,
                    power
                );
            }
